import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Nav from "../components/Nav";


export default class AboutMe extends Component {
  static propTypes = {
    prop: PropTypes
  }

  render() {
    return (
      <div>
        <Nav navItemColor="#eb774c"/>
        <div id="scene">
          <img className="images-par" src="https://cdn.pixabay.com/photo/2017/09/11/20/48/branches-2740419_1280.png" />
          <img src="https://cdn.pixabay.com/photo/2017/09/11/20/45/fir-2740412_1280.png" />
          <img src="https://cdn.pixabay.com/photo/2017/09/14/11/07/water-2748640_1280.png" />
          <div id="div1"></div>
          <div id="div2"></div>
          <div id="div3"></div>
        </div>
      </div>
    )
  }
}
